    return(
        <Container fluid>
            <Nav />
            <Row>
            <p>Home Page</p>
            </Row>
            <Row>
            <Col xs="12" sm="6" md="6" lg="6">
            <AmazonAds />
            </Col>
            <p>hi</p>
            </Row>
        </Container>
    );
};

export default MainPage;
